import axios from "axios";
import choosenSong from "./songsList";

async function todaysSong() {
  const song = choosenSong()
  console.log(song)
  const movieId = await axios.get(`https://youtube.googleapis.com/youtube/v3/search?part=snippet&q=New Girlthemesong&key=AIzaSyCjkUBCiehi5ElDfmHy5-_h8yReodwjUQs
  `)
  .then(res => res.data.items[0].id.videoId)
  // console.log(movieId)
  return (
    `https://www.youtube.com/watch?v=${movieId}`
  )
}



// https://www.youtube.com/watch?v=

export default todaysSong
